import React from 'react';

const Footer: React.FC = () => {
    return (
    <footer className="text-gray-300 py-6 px-6 text-center" style={{ backgroundColor: '#000048' }}>
        <p>&copy; {new Date().getFullYear()} Cognizant, All rights reserved.</p>
    </footer>
);
};

export default Footer;
